import React from 'react';
import Header from '../components/Header'
import Footer from '../components/Footer'

const Layout: React.FunctionComponent<{children, page}> = ({page, children}) => {
    return (
        <div id="layout">
            <Header page={page} />
            {children}
            <Footer />
        </div>
    )
}

export default Layout;
